from io import StringIO


dStr = ""
cStr = StringIO()

for n in reversed(dStr):
    match n:
        case 'A':
            cStr.write('T')
        case 'T':
            cStr.write('A')
        case 'G':
            cStr.write('C')
        case 'C':
            cStr.write('G')

print(cStr.getvalue())